import React, { useEffect, useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "../styles/tereTulemast.css";
import { signOut } from "firebase/auth";
import { auth } from "../firebase-config";
import { Navbar, Container, NavDropdown } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

const MyNavbar = (props) => {
  const [kasutaja, setKasutaja] = useState("");
  const navigate = useNavigate();

  auth.onAuthStateChanged((user) => {
    setKasutaja(user.email);
  });
  const navigeeri = () => {
    navigate("/isiklik");
  };
  return (
    <div>
      <Navbar className="navi" sticky="top">
        <Container>
          <Navbar.Brand href="#">Eesm√§rk</Navbar.Brand>
          <Navbar.Collapse className="justify-content-end">
            <NavDropdown title={kasutaja}>
              <NavDropdown.Item onClick={navigeeri}>
                Statistika
              </NavDropdown.Item>
            </NavDropdown>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
};
export { MyNavbar };
